import {
    makeStyles
} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    root: {
        position: 'fixed',

    },
    container: {
        minHeight: "60px",
        backgroundColor: "#BFBFBD",
        width: "50%",
        marginLeft: "auto",
        marginRight: "auto"
    },
    back: {
        backgroundColor: "red"
    }

}));

export default useStyles;
